package com.zhuxiang.shopping.controller;

import com.alibaba.fastjson.JSON;
import com.zhuxiang.shopping.Employee;
import com.zhuxiang.shopping.repository.EmployeeRepository;
import lombok.extern.slf4j.Slf4j;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

/**
 * @author: zhuxiang
 * @date: 2018/9/14 15:18
 * @description:
 */
@Slf4j
@RestController
@RequestMapping("/es")
public class ElasticSearchController {
    @Autowired
    private EmployeeRepository er;

    /**
     * 增加
     */
    @PostMapping("/add")
    public String add() {
//        QueryBuilders.
//        er.searchSimilar()
        Employee employee = new Employee();
        employee.setId("1");
        employee.setFirstName("xuxu");
        employee.setLastName("zh");
        employee.setAge(26);

        employee.setAbout("");
        Long addStartTime = System.currentTimeMillis();
        er.save(employee);
        Long addEndTime = System.currentTimeMillis();
        log.info("插入ES数据花费时间={}", addEndTime - addStartTime);

        Long queryStartTime = System.currentTimeMillis();
        query();
        Long queryEndTime = System.currentTimeMillis();
        log.info("查询ES数据花费时间={}", queryEndTime - queryStartTime);
        return "success";
    }

    //删除
    @PostMapping("/delete")
    public String delete() {

        er.deleteById("1");

        return "success";
    }

    //局部更新
    @PostMapping("/update")
    public String update() {

        Employee employee = er.queryEmployeeById("1");
        employee.setFirstName("哈哈");
        er.save(employee);

        System.err.println("update a obj");

        return "success";
    }

    //查询
    @PostMapping("/query")
    public Employee query() {
        Long queryStartTime = System.currentTimeMillis();
        Employee accountInfo = er.queryEmployeeById("1");
        System.err.println(JSON.toJSON(accountInfo));
        Long queryEndTime = System.currentTimeMillis();
        log.info("单独查询ES数据花费时间={}", queryEndTime - queryStartTime);
        return accountInfo;

    }
}
